package dxcc

import (
	"io"
	"strings"
	"testing"
)

func TestLookup(t *testing.T) {

	testData := []struct {
		call   string
		entity string
	}{
		{
			call:   "OR4TN",
			entity: "Antarctica",
		},
		{
			call:   "MR6TMS",
			entity: "Scotland",
		},
		{
			call:   "LW7DQQ/Y",
			entity: "Argentina",
		},
		{
			call:   "UI9XA",
			entity: "European Russia",
		},
		{
			call:   "ZS85SARL",
			entity: "South Africa",
		},
	}
	e, err := NewEntityDB(getTestEntities())
	if err != nil {
		t.Errorf("NewEntityDB() returned %s", err)
	}
	for _, tc := range testData {
		ent, ok := e.Lookup(tc.call)
		if !ok {
			t.Errorf("expected an entity to be found")
		}
		if ent.Entity != tc.entity {
			t.Errorf("expected %s, got %s for %s", tc.entity, ent.Entity, tc.call)
		}
	}

}

func TestLookupOverride(t *testing.T) {
	e, err := NewEntityDB(getTestEntities())
	if err != nil {
		t.Fatalf("NewEntityDB returned '%s'", err.Error())
	}
	ent, _ := e.Lookup("OR4TN")
	if ent.CQZone != 38 {
		t.Errorf("expected cqzone=38, got %d", ent.CQZone)
	}
}

